('2248','18','7810','Villa Sandra Jose Blay',Null,'Haus in 1. Meereslinie in Portixol ','31845','An der Cala Gamba, zwischen Portixol und Can Pastilla, liegt dieses Haus direkt am Strandboulevard mit tollem Meerblick.\r\nDas Haus wurde vor 70 Jahren erstellt und mehrmals saniert und renoviert. Ideal für einen Bauträger, der eine moderne Immobilie daraus erschaffen möchte. \r\nDas Haus bietet im EG eine Garage, Büroraum, 2 Schlafzimmer, 1 Badezimmer, Hauswirtschaftsraum, Sauna und Abstellraum.\r\nIm 1. OG (Lift ist vorhanden) befinden sich das Wohn-Esszimmer, eine Küche, 2 Schlafzimmer, Badezimmer und eine ca 30m² große Terrasse mit Jacuzzi und tollem Meerblick.\r\n\r\n','31846','600000','106','2014-08-12 11:14:29','110','2014-08-12 11:15:06',Null,'2238','53','1056',1,'1','0',Null,Null,Null,'31847',Null,'0','0','0',Null,'2015-10-16 19:54:29',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'31848',Null,'31849',Null,'31850',Null,'31851','971 26 9901    629 482 665','31852','0',0,'7');
